import React from 'react'

export default class SampleForm extends React.Component{
  constructor() {
    super()
    this.state = {
      samplename: "",
      clientid: ""
    }
    this.handleChange = this.handleChange.bind(this)
  }
  handleChange(event) {
    this.setState({
      [event.target.name]: event.target.value
    })
    console.log(this.state)
  }
  postData() {
    fetch('http://127.0.0.1:8000/lab/Sample/', {
      method: 'POST',
      body: JSON.stringify(this.state),
      headers: {
        "Content-type": "application/json;charset=utf-8",
        'Accept': 'application/json',
      }
    }).then(async (res) => {
      try {
        const data = await res.json()
        console.log(data.token)
      } catch (error) {
        console.error(error)
      }
    }).catch(err => {
      console.error(err)
    })
  }
    render(){
        return (
        <div className="modal fade" id="exampleModal" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
            <div className="modal-dialog" role="document">
              <div className="modal-content">
                <div className="modal-body">
                  <form action='#'>
                    <div className="form-row">
                        <div className="form-group col-md-6">
                        <label for="SampleName">Sample Name</label>
                        <input type="text" id='samplename' name='samplename' className="form-control" id="text" placeholder="Sample Name"/>
                        </div>
                        <div className="form-group col-md-6">
                        <label for="ClientID">Client ID</label>
                        <input type="text" className="form-control" id="clientid" name="clientid" placeholder="Client ID"/>
                        </div>
                    </div>
                    <div className="form-group">
                        <div className="form-check">
                        <input className="form-check-input" type="checkbox" id="gridCheck"/>
                        <label className="form-check-label" for="gridCheck">
                            Agree
                        </label>
                        </div>
                    </div>
                    <button type="submit" className="btn btn-primary">Save</button>
                  </form>
                </div>
              </div>
            </div>
          </div>
        )
    }
}
